import React from 'react';
import './BaseButton.css';

function Profile(props) {
    const brother = props.brother;

    return (
        <div>
            <Navigation showOnLoad={true} />
            <div className="BrotherCard">
                <img className="BrotherImg" src={brother.headshot} alt={brother.name} />
                <div className="BrotherName">{brother.name}</div>
                <div className="BrotherYearMajor">{brother.major}</div>
                <div className="BrotherYearMajor">Class of {brother.year}</div>
                <Button variant="contained" color="primary" onClick={() => window.open(brother.linkedin)} target="_blank">
                    LinkedIn
                </Button>
                <Button variant="contained" onClick={() => window.open(brother.resume)} target="_blank">
                    Resume
                </Button>
                <Button variant="contained" color="secondary" onClick={() => {props.history.push("/brothers")}} >
                    Back to Brothers
                </Button>
            </div>
         </div>
    )
};

export default BaseButton
